      SELECT DISTINCT - - ( + ( + - COUNT ( * ) ) ) AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q6556.out
    data: |
      -9
